import React from "react";
import Navbarprofile from "../../Components/Navbarprofile/Navbarprofile";
import Navprofile from "../../Components/navprofile/Navprofile";
import { Box } from "@mui/system";
import { blue } from "@mui/material/colors";
import { useState } from "react";
import "./Profile.css";

import {
  MDBCol,
  MDBContainer,
  MDBRow,
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBBtn,
  MDBTypography,
  MDBCardText,
} from "mdb-react-ui-kit";
import { Collapse } from "mdbreact";
import { Grid } from "@mui/material";
const Profile = () => {
  return (
    <Box
      sx={{
        height: "100vh",
        // backgroundColor: "red"
      }}
    >
      <Box sx={{ position: "fixed", top: 0, zIndex: 1 }}>
        <Navbarprofile />
      </Box>
      <Box sx={{ zIndex: 2, position: "fixed" }}>
        <Navprofile />
      </Box>
      <div
        style={{
          // backgroundColor: "blue",
          display: "flex",
          alignItems: "center",
          //marginTop: "40px",
        }}
      >
        <MDBContainer className="py-5 h-100">
          <MDBRow className="justify-content-center align-items-center h-100">
            <MDBCol xl="12" lg="10" md="10" sm="10" xs="8">
              <MDBCard>
                <div
                  className="rounded-top text-white d-flex flex-row"
                  style={{
                    // backgroundColor: "#000",
                    height: "200px",
                  }}
                >
                  <div
                    className="ms-4 mt-5 d-flex flex-column"
                    style={{
                      width: "150px",
                      marginLeft: "30px",
                      //backgroundColor: "red",
                    }}
                  >
                    <MDBCardImage
                      src="https://i.pinimg.com/564x/e1/be/95/e1be95e26e853c491ff3a09e6b996783.jpg"
                      alt="Generic placeholder image"
                      className="mt-3 mb-2 img-thumbnail"
                      fluid
                      style={{ width: "150px", zIndex: "1" }}
                    />
                    <MDBBtn
                      className="mx-2"
                      color="light"
                      rippleColor="dark"
                      style={{
                        height: "28px",
                        width: "120px",
                        fontSize: "18px",
                        display: "felx",
                        alignItems: "center",
                        alignContent: "center",
                        padding: "0px",
                        margin: "0px",
                        textAlign: " right;",
                      }}
                    >
                      <div>Edit profile</div>
                    </MDBBtn>
                  </div>
                  <div
                    //className="ms-3"
                    style={{
                      marginTop: "90px",
                      marginLeft: "50px",
                      // backgroundColor: "red",
                      display: "flex",
                      justifyContent: "row",
                      width: "290px",
                    }}
                  >
                    <MDBTypography
                      tag="h5"
                      style={{ marginRight: "45px", color: "black" }}
                    >
                      User name
                    </MDBTypography>
                  </div>
                </div>
                <div
                  className="p-4 text-black"
                  style={{ backgroundColor: "#f8f9fa" }}
                ></div>

                <MDBCardBody>
                  <div>
                    <p style={{ color: "black" }}></p>
                    <div
                      className="p-4"
                      style={{ borderRadius: "10px solid " }}
                    >
                      <MDBCardText style={{ color: "black" }}></MDBCardText>
                    </div>
                  </div>
                </MDBCardBody>
              </MDBCard>
            </MDBCol>
          </MDBRow>
        </MDBContainer>
      </div>
    </Box>
  );
};

export default Profile;
